<?phpnamespace Nemundo\Meteoschweiz\Content\StationDifference\View;use Nemundo\Content\View\AbstractContentView;use Nemundo\Meteoschweiz\Com\Chart\Difference\QnhDifferenceChart;use Nemundo\Meteoschweiz\Com\Small\MeteoschweizSourceSmall;use Nemundo\Meteoschweiz\Content\StationDifference\TemperatureDifferenceContentType;class QnhDifferenceContentView extends AbstractContentView{    /**     * @var TemperatureDifferenceContentType     */    public $contentType;    protected function loadView()    {        $this->viewName = 'Qnh Difference';        $this->viewId = 'adb47435-c9cc-4262-86e4-f4a853361081';        $this->defaultView = true;    }    public function getContent()    {        $chart = new QnhDifferenceChart($this);        $chart->station1Id = $this->contentType->getDataRow()->station1Id;        $chart->station2Id = $this->contentType->getDataRow()->station2Id;        new MeteoschweizSourceSmall($this);        return parent::getContent();    }}